import React from 'react';
import logo from './logo.svg';
import { Link } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div className="App">
    <div>
      <img src={require("./media/script/rinalam.png")} alt='rinalam'></img>
    </div>
    <div>
    <img src={require("./media/script/about.png")} alt='about'></img>
    </div>
    <div>
    <img src={require("./media/script/Paintings.png")} alt='about'></img>
    </div>
    <div>
    <img src={require("./media/script/Drawings.png")} alt='about'></img>
    </div>
    <div>
    <img src={require("./media/script/Banners.png")} alt='about'></img>
    </div>
    </div>
  );
}

export default App;
